Infested: Series 2

Health-Medical Documentary hosted by Eric Meyers, published by Discovery Channel in 2012 - English narration


Information
------------------------------

Infested: Series 2
Infested unearths real-life horror stories of homes crawling with cockroaches, over-run with rats, invaded by bedbugs, and plagued by vermin hazardous to your physical and mental health. Determined to claim family homes as their own, these invaders use overwhelming numbers, sustained attacks and the threat of disease to conquer houses and apartments. Homes become battlegrounds, leaving their human victims with no place to hide. First-hand accounts and dramatic recreations reveal the pain and anguish of each family s fight to reclaim their homes as their own, but no matter what the outcome, home will never feel the same again.




3)  Hostile Takeovers 
In rural Texas, a couple moves to a seemingly perfect house and start settling in when suddenly, snakeskin and a scorpion are found. The two try to forget about it, but more and more venomous striped bark scorpions are being found. In Houston, Texas, a college student is enjoying life in her apartment. As she gets closer to graduating, she starts hearing rustling sounds from inside her home. She tries to live with them, but she soon detects feces in her bathtub. After she discovers a possum in her kitchen, more and more come into the house and take over. Worse, the possums come with fleas that threaten her health. In California, a couple and their children settle into a nice-looking house, only to start waking up to sick-looking sparrows tapping on the window. As if this isn't unsettling enough, the couple starts discovering tiny parasites called bird mites spreading from their bathroom.


